@org.springframework.context.annotation.Configuration
@org.springframework.context.annotation.Import({ org.activiti.cloud.app.rest.ApplicationsController.class, org.activiti.cloud.app.rest.DeploymentsController.class })
public static class DefaultApplicationsServiceConfiguration implements org.springframework.scheduling.annotation.SchedulingConfigurer {
    @org.springframework.context.annotation.Bean
    @org.springframework.boot.autoconfigure.condition.ConditionalOnMissingBean(type = "ApplicationsService")
    org.activiti.cloud.app.services.ApplicationsService applicationsService() {
        return new org.activiti.cloud.app.services.ApplicationsService();
    }

    @org.springframework.context.annotation.Bean
    @org.springframework.boot.autoconfigure.condition.ConditionalOnMissingBean(type = "DeploymentsService")
    org.activiti.cloud.app.services.DeploymentsService deploymentsService() {
        return new org.activiti.cloud.app.services.DeploymentsService();
    }

    @org.springframework.context.annotation.Bean
    @org.springframework.boot.autoconfigure.condition.ConditionalOnMissingBean(type = "RestTemplate")
    public org.springframework.web.client.RestTemplate restTemplate() {
        return new org.springframework.web.client.RestTemplate();
    }

    @org.springframework.beans.factory.annotation.Value("${activiti.cloud.app.service.refresh.rate:30000}")
    private int refreshRate;

    private static final org.slf4j.Logger LOGGER = org.slf4j.LoggerFactory.getLogger(org.activiti.cloud.app.configuration.ApplicationServiceAutoConfiguration.DefaultApplicationsServiceConfiguration.class);

    @org.springframework.context.annotation.Bean(destroyMethod = "shutdown")
    public java.util.concurrent.Executor taskExecutor() {
        return java.util.concurrent.Executors.newScheduledThreadPool(100);
    }

    @java.lang.Override
    public void configureTasks(org.springframework.scheduling.config.ScheduledTaskRegistrar taskRegistrar) {
        taskRegistrar.setScheduler(taskExecutor());
        taskRegistrar.addTriggerTask(new java.lang.Runnable() {
            @java.lang.Override
            public void run() {
                org.activiti.cloud.app.configuration.ApplicationServiceAutoConfiguration.DefaultApplicationsServiceConfiguration.LOGGER.debug(">>> Refreshing Apps now: " + java.lang.System.currentTimeMillis());
                applicationsService().refresh();
            }
        }, new org.springframework.scheduling.Trigger() {
            @java.lang.Override
            public java.util.Date nextExecutionTime(org.springframework.scheduling.TriggerContext triggerContext) {
                java.util.Calendar nextExecutionTime = new java.util.GregorianCalendar();
                java.util.Date lastActualExecutionTime = triggerContext.lastActualExecutionTime();
                nextExecutionTime.setTime(lastActualExecutionTime != null ? lastActualExecutionTime : new java.util.Date());
                nextExecutionTime.add(java.util.Calendar.MILLISECOND, refreshRate);
                return nextExecutionTime.getTime();
            }
        });
    }
}

